sympy.sympy.core.numbers.__mul__:
def __mul__(self, other):
    if global_parameters.evaluate:
        if isinstance(other, int):
            return Integer(self.p*other)
        elif isinstance(other, Integer):
            return Integer(self.p*other.p)
        elif isinstance(other, Rational):
            return Rational._new(self.p*other.p, other.q, igcd(self.p, other.q))
        return Rational.__mul__(self, other)
    return Rational.__mul__(self, other)

sympy.sympy.core.numbers.__pow__:
def __pow__(self, other, mod=None):
    if mod is not None:
        try:
            other_int = as_int(other)
            mod_int = as_int(mod)
        except ValueError:
            pass
        else:
            return Integer(pow(self.p, other_int, mod_int))

    return super().__pow__(other, mod)

sympy.sympy.core.power._eval_power:
def _eval_power(self, expt):
    b, e = self.as_base_exp()
    if b is S.NaN:
        return (b**e)**expt  # let __new__ handle it

    s = None
    if expt.is_integer:
        s = 1
    elif b.is_polar:  # e.g. exp_polar, besselj, var('p', polar=True)...
        s = 1
    elif e.is_extended_real is not None:
        from sympy.functions.elementary.complexes import arg, im, re, sign
        from sympy.functions.elementary.exponential import exp, log
        from sympy.functions.elementary.integers import floor
        # helper functions ===========================
        def _half(e):
            """Return True if the exponent has a literal 2 as the
            denominator, else None."""
            if getattr(e, 'q', None) == 2:
                return True
            n, d = e.as_numer_denom()
            if n.is_integer and d == 2:
                return True
        def _n2(e):
            """Return ``e`` evaluated to a Number with 2 significant
            digits, else None."""
            try:
                rv = e.evalf(2, strict=True)
                if rv.is_Number:
                    return rv
            except PrecisionExhausted:
                pass
        # ===================================================
        if e.is_extended_real:
            # we need _half(expt) with constant floor or
            # floor(S.Half - e*arg(b)/2/pi) == 0


            # handle -1 as special case
            if e == -1:
                # floor arg. is 1/2 + arg(b)/2/pi
                if _half(expt):
                    if b.is_negative is True:
                        return S.NegativeOne**expt*Pow(-b, e*expt)
                    elif b.is_negative is False:  # XXX ok if im(b) != 0?
                        return Pow(b, -expt)
            elif e.is_even:
                if b.is_extended_real:
                    b = abs(b)
                if b.is_imaginary:
                    b = abs(im(b))*S.ImaginaryUnit

            if (abs(e) < 1) == True or e == 1:
                s = 1  # floor = 0
            elif b.is_extended_nonnegative:
                s = 1  # floor = 0
            elif re(b).is_extended_nonnegative and (abs(e) < 2) == True:
                s = 1  # floor = 0
            elif _half(expt):
                s = exp(2*S.Pi*S.ImaginaryUnit*expt*floor(
                    S.Half - e*arg(b)/(2*S.Pi)))
                if s.is_extended_real and _n2(sign(s) - s) == 0:
                    s = sign(s)
                else:
                    s = None
        else:
            # e.is_extended_real is False requires:
            #     _half(expt) with constant floor or
            #     floor(S.Half - im(e*log(b))/2/pi) == 0
            try:
                s = exp(2*S.ImaginaryUnit*S.Pi*expt*
                    floor(S.Half - im(e*log(b))/2/S.Pi))
                # be careful to test that s is -1 or 1 b/c sign(I) == I:
                # so check that s is real
                if s.is_extended_real and _n2(sign(s) - s) == 0:
                    s = sign(s)
                else:
                    s = None
            except PrecisionExhausted:
                s = None

    if s is not None:
        return s*Pow(b, e*expt)

sympy.sympy.functions.elementary.exponen:
def _eval_power(self, other):
    """exp(arg)**e -> exp(arg*e) if assumptions allow it.
    """
    b, e = self.as_base_exp()
    return Pow._eval_power(Pow(b, e, evaluate=False), other)

def as_base_exp(self):
    """
    Returns the 2-tuple (base, exponent).
    """
    return self.func(1), Mul(*self.args)

def __instancecheck__(cls, instance):
    if exp in instance.__class__.__mro__:
        return True
    return isinstance(instance, Pow) and instance.base is S.Exp1

sympy.sympy.simplify.powsimp.nc_gcd:
def nc_gcd(aa, bb):
    a, b = [i.as_coeff_Mul() for i in [aa, bb]]
    c = gcd(a[0], b[0]).as_numer_denom()[0]
    g = Mul(*(a[1].args_cnc(cset=True)[0] & b[1].args_cnc(cset=True)[0]))
    return _keep_coeff(c, g)
